const { React, Component, Fragment } = require('react')
import Searchbutton from './Searchbutton'

class Searchbar extends Component{
    render(){
        return(
            <Fragment>
                <input id="searchbar" placeholder="Search"></input>
                <Searchbutton />
            </Fragment>
            
        )
    }
}

export default Searchbar
